The stat bar issue is still NOT fixed. Looking at the close-up the user provided, the gradient bar clearly does not fill the full height of the dark track container. There's visible dark space above and below the colored bar.

Current CSS:
```css
.stat-bar-container {
    margin-top: 10px;
    height: 10px;
    background: rgba(0, 0, 0, 0.4);
    border-radius: 5px;
    overflow: hidden;
    position: relative;
}

.stat-bar-container::after {
    content: "";
    position: absolute;
    inset: 0;
    border-radius: inherit;
    box-shadow:
        inset 0 1px 0 rgba(255,255,255,0.18),
        inset 0 -1px 0 rgba(0,0,0,0.28);
    pointer-events: none;
    z-index: 10;
}

.stat-bar {
    position: absolute;
    inset: 0;
    display: block;
    background: linear-gradient(90deg, var(--red-dark), var(--gold));
    border-radius: 0;
    z-index: 2;
}
```

The bar uses `inset: 0` which should make it fill the container completely, but it clearly doesn't visually. I can see a full-page screenshot of the horse detail page. What diagnostics should Claude collect from Chrome DevTools to debug this? Be specific about what computed styles, measurements, or DOM info you need.

messages.content:
That 6px offset **cannot** be caused by `line-height` alone. `line-height` affects inline layout, not an absolutely positioned block. If `top: 0` is true but the bars *visual* top is +6px, youre dealing with **either a transform or margin** being applied somewhere (or the element isnt actually the one you think it is).

### Most likely causes (in order)
1. **`transform: translateY(6px)`** on `.stat-bar` or an ancestor  
2. **`margin-top: 6px`** on `.stat-bar` (not captured in your summary)  
3. **Youre inspecting the second bar (`.stat-bar-max`) which has extra styles**  
4. **A parent has `transform` + `overflow:hidden` causing visual offset**

### What to check **now**
In DevTools, run this in Console for both `.stat-bar` elements:

```js
[...document.querySelectorAll('.stat-bar')].map(el => ({
  class: el.className,
  rect: el.getBoundingClientRect(),
  marginTop: getComputedStyle(el).marginTop,
  transform: getComputedStyle(el).transform
}));
```

Then compare the container:

```js
const c = document.querySelector('.stat-bar-container');
({ rect: c.getBoundingClientRect(), transform: getComputedStyle(c).transform });
```

If any `transform` is non`none`, youve found the offset.

---

## Fix (add this now to eliminate layout influence)
Even if you dont find the rule yet, this will hardreset any accidental offset:

```css
.stat-bar-container {
  line-height: 0;
  font-size: 0;
}

.stat-bar,
.stat-bar-max {
  top: 0;
  left: 0;
  height: 100%;
  margin: 0;
  transform: none;
}
```

If the offset disappears after this, then a transform/margin was the culprit.

---

### If its the `.stat-bar-max` overlay
Its possible the max bar is **stacked above and offset**, making it look like the base bar is lower. Try toggling `.stat-bar-max` visibility in DevTools. If the gap disappears, you need:

```css
.stat-bar-max {
  top: 0;
  bottom: 0;
  height: 100%;
}
```

---

### Final: ask Claude to check these exact values
- `margin-top` on `.stat-bar` and `.stat-bar-max`
- `transform` on `.stat-bar`, `.stat-bar-max`, `.stat-bar-container`, and `.stat-box`
- `getBoundingClientRect().top` for both bars and container

Once you send those values, I can tell you exactly which rule is causing the 6px shift.

Yesbased on the fix and the screenshot, the bar now **visually fills the track height correctly**. The dark gaps above/below are gone and the gradient occupies the full 10px.

Two quick refinements to improve clarity and polish:

---

### 1) Prevent overlap artifacts between base + max bar
Since you have two stacked bars (`.stat-bar` and `.stat-bar-max`), add explicit z-index and opacity to keep them readable:

```css
.stat-bar {
  z-index: 2;
}
.stat-bar-max {
  z-index: 1;
  opacity: 0.35;
}
```

---

### 2) Slightly reduce the strong inner shadow (now that bars are clean)
That inset shadow is still making the bar look pinched. Soften it:

```css
.stat-bar-container::after {
  box-shadow:
    inset 0 0.5px 0 rgba(255,255,255,0.12),
    inset 0 -0.5px 0 rgba(0,0,0,0.18);
}
```

---

If you want, send a close-up crop of just the bar row and I can fine-tune the contrast/height visually.
